import React from 'react';
import PropTypes from 'prop-types';
import dino from '../img/dinoLove.svg';
import {
	Panel,
	PanelHeader,
	Header,
	Button,
	Group,
	Cell,
	Div,
	Avatar,
	Image,
} from '@vkontakte/vkui';
import './Home.css';

const Home = ({ id, go, fetchedUser }) => (
	<Panel id={id}>
		<PanelHeader>..и немного о важном</PanelHeader>

		<Group className={'Container'} mode={'card'}>
			<Div className={'Greeting'}>
				<img className={'Dino'} src={dino} />
				<Div>
					<p> {`привет, ${fetchedUser.first_name}`}</p>
					<p> сегодня поговорим о важном...</p>
					<p> насколько твои друзья любят котиков</p>
				</Div>
			</Div>
		</Group>

		<Div className='Button'>
			<Button
				onClick={go}
				data-to='mainPage'
				appearance={'positive'}
				size={'i'}
				stretched={false}
			>
				Поехали
			</Button>
		</Div>
	</Panel>
);

Home.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Home;
